import { AcceptButton } from "./AcceptButton.js"
import { DenyButton } from "./DenyButton.js"

export const AcceptDenyContainer = ({ requests, id }) => {

    return (
        <>
            {!requests.isPending ?
                <div>
                      <DenyButton requests={requests} id={id} refresh={refresh} />
                    <AcceptButton requests={requests} id={id} refresh={refresh} />
                  </div> : "" }
        </>
    )
}
